import React from "react";
import Subpanel from "./Subpanel";

export default function BodyPanel(props) {
  return (
    <div id="bodypanel-container">
      <div id="bodypanel">
        <Subpanel
          type="requests"
          ingredientList={props.requestedIngredients}
          removeRequestedIngredient={props.removeRequestedIngredient}
        />
        <i id="arrow-icon" className="fa-regular fa-circle-right"></i>
        <Subpanel
          type="results"
          ingredientList={props.resultIngredients}
          addRequestedIngredient={props.addRequestedIngredient}
        />
      </div>
    </div>
  );
}
